import "./home.scss"
import { AcUnit } from "@material-ui/icons"
import NAVBAR from "../components/navbar/NAVBAR"

function HOME() {
    return (
        <div className='home'>
            <NAVBAR/>
            <img src="https://c4.wallpaperflare.com/wallpaper/500/442/354/outrun-vaporwave-hd-wallpaper-preview.jpg" width={1900}/>
            
        </div>
    )
}

export default HOME
